// SPDX-License-Identifier: MIT

pragma solidity =0.8.28;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Disperse is Ownable {
    address private treasury;
    uint256 public fee;

    constructor() Ownable(msg.sender) {
        treasury = msg.sender;
    }

    function setTreasury (address _newTreasury) external onlyOwner {
        treasury = _newTreasury;
    }

    function setFee (uint256 _fee) external onlyOwner {
        fee = _fee;
    }

    function airdrop(
        uint256[] memory amounts,
        address token,
        address[] memory users
    ) public payable {

        require(msg.value >= fee, "Insufficient ETH for fee.");

        //Transfer funds to Treasury
        payable(treasury).transfer(msg.value);

        require(amounts.length == users.length, "Arrays length mismatch");        
        uint256 len = users.length;
        uint256 total_amount = 0;
        
        for (uint256 i = 0; i < len; i++) {
            total_amount += amounts[i];
        }

        require(IERC20(token).transferFrom(msg.sender, address(this), total_amount), "Transfer to contract failed");

        for (uint256 i = 0; i < len; i++) {
            require(IERC20(token).transfer(users[i], amounts[i]), "Transfer to recipient failed");
        }
    }
}

